import React from "react";
import NavBar from "@components/navBar"
import Header from "./component/header"
import PushList from "./component/pushList"
import { observer, inject } from "mobx-react"
import "./style.scss"
type UserInfoProps = {
 userState: UserState
}
const UserInfo = (props: UserInfoProps) => {
 const { userState } = props as propsData;
 const { pullRed } = userState as UserState;
 return (
  <div className="userinfo">
   <Header />
   <div className="tabs">
    <p className={`tab activity`}>
     <span className="tab-name">推荐赛事</span>
     <span className="number">{pullRed.recommendMatchNum}</span>
    </p>
    <p className={`tab activity`} >
     <span className="tab-name">红单场次</span>
     <span className="number">{pullRed.redListHits}</span>
    </p>
   </div>
   <PushList />
   <NavBar />
  </div>
 )
}
export default inject('userState')((observer(UserInfo)));
